create table locacao (
	cod_locacao INT PRIMARY KEY,
	dt_locacao DATE,
	hora_locacao VARCHAR(50),
	qtd INT,
	desconto VARCHAR(2),
	cod_cliente INT,
	cod_carro INT,
	cod_avaliacao INT,
	cod_funcionario INT,
	FOREIGN KEY (cod_cliente) REFERENCES cliente (cod_cliente),
	FOREIGN KEY (cod_carro) REFERENCES carro (cod_carro),
	FOREIGN KEY (cod_avaliacao) REFERENCES avaliacao (cod_avaliacao),
	FOREIGN KEY (cod_funcionario) REFERENCES funcionario (cod_funcionario),
	
);

















